.form-popup {
  margin: 0 auto;
  width: 100%;
  max-width: 700px;
  height: auto;
  box-sizing: border-box;
  border: solid 1px #000;
}
.form-popup__code {
  display: flex;
  width: calc(100% - 40px);
  height: 300px;
  border: solid 1px #000;
  margin: 20px;
}
.form-popup__result-code {
  width: calc(100% - 80px);
  margin: 40px;
  min-height: 200px;
  height: min-content;
  border-radius: 8px;
  resize: none;
}
.form-popup__name {
  padding: 16px;
  position: relative;
  box-sizing: border-box;
}
.form-popup__name:after {
  content: "";
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 1px;
  background-color: #dee2e6;
}
.form-popup__name p {
  text-align: start;
  margin: 0;
  font-family: "Inter", "Arial", sans-serif;
  color: #303c54;
  font-weight: 700;
  font-size: 20px;
  line-height: 120%;
}
.form-popup__close {
  position: absolute;
  top: 20px;
  right: 16px;
  color: #303c54;
  width: 16px;
  height: 16px;
}

.form-creator {
  display: flex;
  width: 100%;
  height: 100%;
  padding: 16px;
  box-sizing: border-box;
}
.form-creator__wrapper {
  width: 100%;
  display: flex;
  flex-direction: column;
  row-gap: 21px;
}

.form-visual {
  padding: 0 16px 30px;
}
.form-visual__name {
  text-align: left;
  font-family: "Inter", "Arial", sans-serif;
  font-weight: 700;
  font-size: 16px;
  line-height: 150%;
  color: #303c54;
  margin: 0 0 30px;
}
